import React from 'react';
import SearchBar from './SearchBar';

class App extends React.Component {


    onWordEntered = (word) => {
        console.log(word);
    }

    render() {
        return (
            <div>
                <SearchBar onWordEntered={this.onWordEntered} />
            </div>
        );
    }
}

export default App;
